import Square from "./Square";

function BoardRow(props) {
  const tracker = [0, 1, 2, 3, 4, 5];
  return (
    <div
      className="d-flex Board-row flex-column gap-1"
      id={"row" + props.number}
      onClick={props.handlClick}
    >
      {tracker.map((data) => {
        const temp = data + parseInt(props.number) * 5;
        console.log(temp);
        return <Square color="blue" id={"Square" + temp} />;
      })}
    </div>
  );
}
export default BoardRow;
